"""
Given a string, find the length of the longest substring without repeating characters.

Example 1:
    Input: "abcabcbb"
    Output: 3 
    Explanation: The answer is "abc", with the length of 3. 
    
Example 2:
    Input: "bbbbb"
    Output: 1
    Explanation: The answer is "b", with the length of 1.
    
Example 3:
    Input: "pwwkew"
    Output: 3
    Explanation: The answer is "wke", with the length of 3. 
                 Note: answer must be a substring, 
                       "pwke" is a subsequence and not a substring.
"""


def lengthOfLongestSubstring(s):
    already_visited = {}
    curr_max = 0
    substr_idx_start = 0
    
    for substr_idx_end in range(len(s)):
        print("just adding:", already_visited)
        char = s[substr_idx_end]
        if (char in already_visited) and (substr_idx_start <= already_visited[char]):
            substr_idx_start = already_visited[char] + 1
            print(f"encountered {char} at {substr_idx_end}:", already_visited)
        already_visited[char] = substr_idx_end
        curr_max = max(curr_max, substr_idx_end-substr_idx_start+1)
    
    return curr_max
  
  
  
